import React from 'react';

function Footer() {
	return(
		<div className="footer">
			<footer class="py-2 bg-dark fixed-bottom">
				<div class="container">
					<p class="m-0 text-center text-white">
						Copyright &copy; Dogs4All 2022
					</p>
				</div>
			</footer>
		</div>
		);
}
export default Footer;
